    false,nt"url": null,nt"notes": "The Double-crested Cormorant, or DCCO,
    is the most widely distributed cormorant of the six North American cormorant species.
    This work is an attempt to review and consolidate what is currently known about
    DCCOs in Lake Michigan. This includes an overview of the occurrence of DCCOs in
    the Great Lakes basin, as well as discussion of both population trends and ecology
    of these birds in Lake Michigan. Finally, this work describes the recent changes
    in management legislation concerning DCCOs in the United States.",nt"owner_org":
